import React from 'react';

function Leadership() {
  return (
    <div className="leadership">
      <h2>Leadership &amp; Extra-Curricular Activities</h2>
      <p><mark className="highlight-pink_background"><strong>Decipher | </strong></mark><em><mark className="highlight-pink_background">Operation Lead</mark></em></p>
      <p>Blockchain Academic group based at Seoul National University</p>
      <p><mark className="highlight-pink_background"><strong>4th Protocol Camp | </strong></mark><em><mark className="highlight-pink_background">Participant</mark></em></p>
      <p>Blockchain Bootcamp Sponsored by Hashed X Hanwha Dream Plus</p>
      <p><mark className="highlight-pink_background"><strong>WISET Global Mentoring: Megazone Cloud Global</strong></mark><em><mark className="highlight-pink_background"> </mark></em><mark className="highlight-pink_background">|</mark><em><mark className="highlight-pink_background"> Mentee</mark></em></p>
      <p>Global Mentoring Program held by WISET X Megazone Cloud Global</p>
      <p><mark className="highlight-pink_background"><strong>Samsung Junior SW Cup</strong></mark><em><mark className="highlight-pink_background"> </mark></em><mark className="highlight-pink_background">|</mark><em><mark className="highlight-pink_background"> Mentor</mark></em></p>
      <p>Guided middle school teams through software development projects</p>
      <p><mark className="highlight-pink_background"><strong>Samsung Dream Class</strong></mark><mark className="highlight-pink_background"> | </mark><em><mark className="highlight-pink_background">Mentor</mark></em></p>
      <p>Managed learning for middle school students with limited educational resources</p>
    </div>
  );
}

export default Leadership;
